const shapeBuilder = document.getElementById('shape-builder');
const jsonTextArea = document.getElementById('json-text');
const shape = {};

function getTableChildren(tableName) {
    if (tableName === "root") {
        return {
            "client": { "type": "object" },
            "person": { "type": "object" },
            "folder": { "type": "object" },
            "scheme": { "type": "object" },
            "company": { "type": "object" },
            "payroll": { "type": "object" },
            "payrollmember": { "type": "object" },
            "area": { "type": "object" },
            "paylocation": { "type": "object" }
        }
    }

    const tableChildren = {};

    columns.forEach(col => {
        if (col.table_name.slice(3) === tableName) {
            const fieldName = col.column_name.replace(/id$/, ""); // Remove trailing "ID"
            const isObject = col.column_name.endsWith("id");
            if (fieldName != tableName) {
                tableChildren[fieldName] = { type: isObject ? "object" : "field" };
            }
        } else if (col.column_name == tableName + "id") {
            tableChildren[col.table_name.slice(3)] = { type: "list" };
        }
    });

    return orderObjectByKey(tableChildren);
}

function addListItem(parent, tableName, shapePart) {
    const listItem = document.createElement('li');

    const datalist = document.createElement('datalist');
    datalist.id = `datalist-${tableName}`;

    const children = getTableChildren(tableName);
    // Get available children based on the parent shape
    const availableChildren = Object.keys(children);

    // Populate select options
    for (const childName of availableChildren) {
        const option = document.createElement('option');
        option.value = childName;
        option.textContent = childName;
        datalist.appendChild(option);
    }

    document.body.appendChild(datalist);

    const input = document.createElement('input');
    input.type = 'text';
    input.setAttribute("list",`datalist-${tableName}`); 
    listItem.appendChild(input);

    datalist.offsetWidth; // Trigger reflow

    let selectValue = "";

    

    const removeButton = document.createElement('button');
    removeButton.textContent = 'Remove';
    removeButton.classList.add('hidden');
    listItem.appendChild(removeButton);

    function ensureEmptyItem() {
        // Check for and add an empty list item if needed
        let emptySelect = false;

        for (const childLI of parent.children) {
            if (childLI.tagName === 'LI') {
                for (const childSelect of childLI.children) {
                    if (childSelect.tagName == "SELECT" && childSelect.value == "") {
                        emptySelect = true;
                        break;
                    }
                }
            }
        }
        if (!emptySelect) {
            addListItem(parent, tableName, shapePart);
        }
    }

    // Event listener for option selection (add child item)
    input.addEventListener('change', (event) => {
        const selectedChild = event.target.value;

        if (!(selectedChild in children)) {
            return;
        }

        if (selectValue) {
            delete shapePart[selectValue];
        }
        selectValue = selectedChild;

        if (selectedChild) {
            removeButton.classList.remove('hidden');
            const childShape = children[selectedChild];

            // Remove existing nested lists before adding a new one for object or list type
            const existingLists = listItem.querySelectorAll('ul');
            existingLists.forEach((list) => list.remove());

            if (childShape.type === 'object') {
                // Because it is an object this shape will be listed in shapes
                const newShapePart = {};
                shapePart[selectedChild] = newShapePart;
                addShape(listItem, selectedChild, newShapePart);
            } else if (childShape.type === 'list') {
                // Because it is a list this shape will be listed in shapes
                const newShapePart = {};
                shapePart[selectedChild] = [newShapePart];
                addShape(listItem, selectedChild, newShapePart);
            } else {
                // Normal field
                shapePart[selectedChild] = null;
            }

            ensureEmptyItem();
            setJSON();

        }
    });

    // Event listener for remove button click
    removeButton.addEventListener('click', () => {
        parent.removeChild(listItem);
        delete shapePart[selectValue];
        ensureEmptyItem();
        setJSON();
    });

    parent.appendChild(listItem);
}

function addShape(parent, tableName, shapePart) {
    const list = document.createElement('ul');

    addListItem(list, tableName, shapePart);
    parent.appendChild(list);
}

function setJSON() {
    const jsonString = JSON.stringify(shape, null, 2);
    jsonTextArea.value = jsonString;
}

function orderObjectByKey(obj) {
    const sortedKeys = Object.keys(obj).sort();
    const orderedObject = {};
    for (const key of sortedKeys) {
      orderedObject[key] = obj[key];
    }
    return orderedObject;
  }

// Initial call to add the root element
addShape(shapeBuilder, "root", shape);


